htest du, dass ich deine pers√∂nlichen Daten l√∂sche, dann mache ich das auch, es sei denn, ich muss sie aus rechtlichen Gr√ºnden aufbewahren, z.B. in Rechnungen f√ºr das Finanzamt. Solltest du sonst irgendwelche Fragen zu deinen Daten haben, melde dich einfach bei mir.</li>\n</ul>','','','',NULL,'','','','','','','','above',NULL,'',NULL,NULL,'','','','','',0,'ascending','','','','',NULL,'','','','','','','','',NULL,NULL,'',4,0,0,'','','','',NULL,'','',NULL,'',NULL,0,0,'','none','','','',NULL,NULL,0,300,0,'',0,0,0,0,0,'',NULL,'','a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}','','','','ascending',0,'','','','','com_default',NULL,NULL,'sourceText',NULL,'',NULL);
